<style>

    body {
      padding: 0;
      margin: 0;
      background: #E8E8E8;
      font-family: Montserrat, sans-serif;
    }

    h1, h2, h3 {
      font-size: 1.3em;
      font-weight: 100;
      color: #808080;
      margin: 0;
      margin-bottom: 3px;
    }

    h2 {
      font-size: 1em;
      margin-bottom: 3px;
    }

    h3 {
      font-size: .65em;
      margin-bottom: 10px;
    }

    h3 a {
      color: #808080;
    }

    #map {
      width: 900px;
      height: 600px;
      margin-left: 0px;
      margin-top: 0px;
      margin-bottom: 5px;
    }

    .slider {
      width: 200px;
    }

    #slider-wrapper {
      position: absolute;
      color: #808080;
      padding: 0px;
      margin: 0px;
      top: 480px;
      left: 480px;
      display: none;
    }

    #slider-wrapper div {
      text-align: center;
      font-size: .8em;
    }

    #slider-wrapper input {
      width:150px;
    }

    .state {
      stroke: #696969;
      stroke-width: 1;
    }

    .legend-linear {
      fill: #696969;
      font-size: .7em;
    }

    #min-year {
      float: left;
    }

    #max-year {
      float: right;
    }

    div.tooltip {
      position: absolute;
      max-width: 220px;
      padding: 3px 6px;
      color: grey;
      font: .8em sans-serif;
      background: whitesmoke;
      border: 1px solid grey;
      border-radius: 3px;
      pointer-events: none;
    }

    .legend-text {
      fill: #000000;
      text-anchor: middle;
      font-family: 'Arimo', sans-serif;
    }

    .legend-title {
      font-size: 1.5em;
      font-weight: bold;
    }

    .legend-subtitle {
      font-size: 1.3em;
    }

    .legend-subsubtitle {
      font-size: 1.1em;
    }

    .label {
      fill: #000000;
      font-family: 'Overpass Mono', monospace;
    }

    .swatch {
      stroke: #696969;
      stroke-width:.3;
    }

    .icon {
      fill: #696969;
    }

    .legend-rect {
      fill: #ffffff;
      fill-opacity: .75;
      stroke-width: .3;
      stroke: #696969;
      rx: 5;
      ry: 5;
    }


</style>
